#include<iostream>
#include<string.h>
using namespace std;
class Solution {
public:
    string minWindow(string s, string t) {
        int need[128];
        int found[128];
        memset(need, 0, sizeof(int)*128);
        memset(found, 0, sizeof(int)*128);
        int count = 0;
        for(int i=0;i<t.size();i++){
            need[t[i]]++;
            count++;
        }
        //cout<<count<<endl;
        int begin = 0;
        int end = 0;
        int maxsize = 0x7fffffff;
        int b=0,e=0;
        //ADOBECODEBANC
        while(1){
            if(count==0){
                while(begin<=end-1){
                    if(need[s[begin]]>0){
                        break;
                    }
                    else{
                        begin++;
                    }
                }
                //cout<<begin<<"-"<<end<<endl;
                if (end-begin < maxsize){
                    maxsize = end-begin;
                    b = begin;
                    e = end-1;
                    if(maxsize==t.size())
                        break;
                }
                begin++;
                end = begin;
                count = t.size();
                memset(found, 0, sizeof(int)*128);


            }
            else{
                if(end<s.size()){
                    if(found[s[end]] < need[s[end]]){
                        count--;
                        found[s[end]]++;
                    }
                }
                else{
                    //cout<<end<<endl;
                    break;
                }
                //cout<<count<<endl;
                end++;
            }
        }
        if(maxsize == 0x7fffffff)
            return "";
        else{
            //cout<<b<<" "<<e<<endl;
            return s.substr(b, e-b+1);
        }
    }
};
int main(){
    Solution s;
    string ss = "ADOBECODEBANC";
    string tt = "ABC";
    cout<<s.minWindow(ss, tt)<<endl;
    ss = "A";
    tt = "A";
    ss = "";
    tt = "fxtusxonrfdrhxjamdkwm";
    cout<<s.minWindow(ss, tt)<<endl;;
    ss = "";
    tt = "";
    cout<<s.minWindow(ss, tt)<<endl;
}
